
//Funcion que llena el modal del practicante

function agregaform_u(datos){

	d=datos.split('||');

	
	$('#nombre').val(d[1]);
	$('#cuenta').val(d[0]);
	$('#email').val(d[7]);
	$('#telefono').val(d[8]);
	$('#labora').val(d[16]);
	
}
//Funcion que llena el modal de la empresa
function agregaform(datos){

	d=datos.split('||');

	$('#nombree').val(d[2]);
	$('#direccion').val(d[3]);
	$('#tipo').val(d[9]);
	$('#departamento').val(d[10]);
	$('#jefe').val(d[11]);
	$('#titulo').val(d[12]);
	$('#cargo').val(d[13]);
	$('#correo').val(d[14]);
	$('#telefonoj').val(d[15]);
	
	
}
